import React from "react";
import logo from "../assets/logo.png";
import homeIcon from "../assets/home.png";
import aboutIcon from "../assets/about.png";
import projectsIcon from "../assets/projects.png";
import contactIcon from "../assets/contact.png";

const Sidebar = () => (
  <div className="sidebar">
    <div className="sidebar-logo">
      <img src={logo} alt="Logo" className="icon" />
      My Portfolio
    </div>
    <nav>
      <a href="#home"><img src={homeIcon} alt="Home" className="icon" />Home</a>
      <a href="#about"><img src={aboutIcon} alt="About" className="icon" />About</a>
      <a href="#projects"><img src={projectsIcon} alt="Projects" className="icon" />Projects</a>
      <a href="#contact"><img src={contactIcon} alt="Contact" className="icon" />Contact</a>
    </nav>
  </div>
);

export default Sidebar;
